import React from "react";

const ImageCollage = ({ imageUrls }) => {
    const gridStyle = {
        display: "grid",
        gridTemplateColumns: "repeat(auto-fit, minmax(150px, 1fr))",
        gridGap: "10px",
    };

    const imageStyle = {
        objectFit: "cover",
        width: "100%",
        height: "100%",
    };

    return (
        <div style={gridStyle}>
            {imageUrls.map((url, index) => (
                <img key={index} src={url} alt={`Image ${index}`} style={imageStyle} />
            ))}
        </div>
    );
};

export default ImageCollage;
